import AboutServices from './AboutServices';




function Home() {
  return (
    <div style={{backgroundColor:"#e9214e;"}}>
<Carousel/>
<HomeQual/>
<h1 style={{color:"#8D8D8D"}}>Services</h1>
<AboutServices/>

<h1 className='headding'>Best Seller</h1>
